I'm trying to write a DNS server in golang that forwards all requests to 8.8.8.8 and 1.1.1.1, and stores in a map all the hostnames to the resolved ips.

I have the following code so far:

```
package main

import (
	"fmt"
	"log"
	"net"
	"sync"

	"github.com/miekg/dns"
)

var (
	hostnameToIPs = make(map[string][]net.IP)
	mutex         sync.Mutex
)

func main() {
	dns.HandleFunc(".", func(w dns.ResponseWriter, req *dns.Msg) {
		client := new(dns.Client)
		in, err := client.Exchange(req, "8.8.8.8:53")
		if err != nil {
			log.Fatal(err)
		}
		if in != nil {
			hostname := req.Question[0].Name
			ips := make([]net.IP, 0, len(in.Answer))
			for _, answer := range in.Answer {
				if a, ok := answer.(*dns.A); ok {
					ips = append(ips, a.A)
				}
			}
			mutex.Lock()
			hostnameToIPs[hostname] = ips
			mutex.Unlock()
			log.Printf("%s -> %v\n", hostname, ips)
		}
		w.WriteMsg(in)
	})

	server := &dns.Server{
		Addr: ":53",
		Net:  "udp",
	}
	err := server.ListenAndServe()
	if err != nil {
		log.Fatal(err)
	}
}
```

This code works, but I'm not sure if it's the best way to do it. I'm using the `miekg/dns` package to handle DNS requests and responses, and I'm using a mutex to protect the `hostnameToIPs` map. I'm also using the `dns.Client` to forward the requests to 8.8.8.8 and 1.1.1.1.

Is there a better way to do this? Is there a way to avoid using a mutex? Is there a way to use a different DNS server to forward the requests to?

Any suggestions or improvements would be greatly appreciated!

## Answer (1)

I would suggest using a goroutine to handle each request
